export const contactsSectionBoxStyles = {
  width: '100%',
  padding: '60px',
  boxSizing: 'border-box',
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'center',
  backgroundColor: 'secondary.light',
};

export const contactsHeaderStyles = { mb: '3%', mt: '3%' };
